import {Route, Switch} from "react-router-dom";
import Pages from "../Pages";

const MountRoutes = () => {
	const routes = {
		"/": Pages.MainPage,
		"/main-page": Pages.MainPage,
	}

	return [
		...Object.entries(routes).map(([path, component]) =>
			<Route exact path={path} component={component}/>
		)
	];
}

const Routes = () => (
		<Route>
			<div>
				<Switch>
					{MountRoutes()}
				</Switch>
			</div>
		</Route>
	);

export default Routes;
